import React from 'react'
import {Link, useNavigate } from "react-router-dom"
const menuList=['ABOUT',"서비스","연락처","후기"]
import './Na.css';


const Navb = () => {
  return (
    <div className='menu-area'>
      <ul className='menu-list'>
        {menuList.map((menu)=><li>{menu}</li>)}
      </ul>
    </div>
  )
}

export default Navb
